export class UsuarioPersona{
    constructor(
       public _id: string, 
       public persona: Persona, // Objeto o ID en realidad de "Persona"
       public nombre_usuario: string,
       public password: string,
       public correo_electronico: string,
       public rol: string       
    ){}
}
